    return (
      <div className="App">
        <header className="App-header"> 
         <div className="but">
            <Button variant="outlined" color="primary" onClick = {umnog}> * </Button>
            <Button variant="outlined" color="primary" onClick = {delenie}>/</Button>
          </div>
          <div className="but1">
            {countn}
          </div> 
        </header>
      <div>  
  </div>
  </div>
    );
  }
  export default DopComponentn;
